import React from "react";
import axios from "axios";

export default async function GetCollectionFunc(
  limitVal = 4,
  pageVal = 1,
  searchVal = ""
) {
  const linkApi = `api/categories?limit=${limitVal}&page=${pageVal}`;

  if (searchVal !== "") {
    linkApi += `&search=${searchVal}`;
  }

  // TODO
  const res = await axios.get(linkApi);
  const data = await res.data;

  return { data };
}
